import React from "react";
import {Link} from 'react-router-dom'


export default function Card({id,name,image,types}){
    console.log(types)
    return(
        <div>
            <Link to={`/home/${id}`}>
            <h3>{name}</h3>
            <img src={image} alt="imagen no encontrada" width="250px"/>
            </Link>
            <div>
            {types?.map((e,i)=><div key={i}>{e}</div>)}

            </div>
        </div>
    )
}
